import React from "react";

import { Row, Col, Card } from 'react-materialize';

import HotelPraia from '../../images/home/hotel_praia.jpg';
import Restaurante from '../../images/home/restaurante.jpg';

import Linha from '../../images/home/linha.png';
import './home.css';


function Subtitle(props){
  return(
    <h4 className="subtitle" >{props.sub}</h4>
    );
}


const Home = () => (
  <Row>
    <Col m={10} s={12}>
        <img src={Linha} className="hrpresub"></img> 
        <Subtitle sub="Mais Recentes"/>
        <img src={Linha} className="hrpossub"></img> 
        <Card>
          <div className="content">
              <Col s={8} m={4} offset="s2" >
                <img src={HotelPraia} className="responsive-img"/> 
              </Col>
            <h5>Hotel na praia</h5>
            <div><p>Estrelas</p></div>
            <p>Descrição do lugar com uma descrição bem discritiva descrevendo o lugar.</p>
          </div> 
          <hr/><br/>  
          <div className="content">
              <Col s={8} m={4} offset="s2" >
                <img src={Restaurante} className="responsive-img"/> 
              </Col>
            <h5>Restaurante maneiro</h5>
            <div><p>Estrelas</p></div>
            <p>A mesma descrição do lugar com uma descrição bem discritiva descrevendo o lugar.</p>
          </div> 
          <hr/> 
        </Card>
    </Col>
  </Row>
);

export default Home;
